計の30%の魔法攻撃ダメージを与える","Shot Many Fire Balls into Area by 5 block dimension from Sky. Dealings 30% Magic Attack Damages of Total each Explosion to The Ground Area of 3x3 Block");createText("ara","أطلق العديد من كرات النار في منطقة ببعد 5 كتل من السماء. يُلحق 30% من إجمالي أضرار الهجوم السحري لكل انفجار بالمنطقة الأرضية للمربع 3x3","Shot Many Fire Balls into Area by 5 block dimension from Sky. Dealings 30% Magic Attack Damages of Total each Explosion to The Ground Area of 3x3 Block");createText("kor","하늘에서 5블록 크기의 영역에 많은 불덩어리를 발사합니다. 3x3 블록의 지상 영역에 폭발할 때마다 총 마법 공격력의 30% 피해를 줍니다.","Shot Many Fire Balls into Area by 5 block dimension from Sky. Dealings 30% Magic Attack Damages of Total each Explosion to The Ground Area of 3x3 Block");createText("vie","Bắn nhiều quả cầu lửa vào khu vực có kích thước 5 khối từ Bầu trời. Gây 30% sát thương phép thuật trên tổng mỗi vụ nổ lên diện tích mặt đất của khối 3x3","Shot Many Fire Balls into Area by 5 block dimension from Sky. Dealings 30% Magic Attack Damages of Total each Explosion to The Ground Area of 3x3 Block");createText("rus","Выстрелите множеством огненных шаров по площади на расстоянии 5 блоков от неба. Наносит 30% урона от магических атак от общего количества каждого взрыва по площади блока 3х3.","Shot Many Fire Balls into Area by 5 block dimension from Sky. Dealings 30% Magic Attack Damages of Total each Explosion to The Ground Area of 3x3 Block");createText("tur","Gökyüzünden 5 blok boyutunda Alana Çok sayıda Ateş Topu fırlatıldı. 3x3 Blok Zemin Alanına her Patlamada Toplamın %30 Büyü Saldırısı Hasarı verir","Shot Many Fire Balls into Area by 5 block dimension from Sky. Dealings 30% Magic Attack Damages of Total each Explosion to The Ground Area of 3x3 Block");createText("ita","Hai sparato molte palle di fuoco in un'area di 5 blocchi di dimensione dal cielo. Infligge il 30% dei danni da attacco magico del totale per ogni esplosione nell'area terrestre del blocco 3x3","Shot Many Fire Balls into Area by 5 block dimension fr